message:
Uma pesquisa realizada pelo José Moisés, cientista político da USP, concluiu que a corrupção destrói a democracia.

Segundo o professor:

- A corrupção diminui a adesão ao regime democrático;
- A corrupção estimula a aceitação de escolhas autoritárias;
- A corrupção influencia negativamente a submissão à lei;
- A corrupção frauda o princípio da igualdade política;
- A corrupção faz com que as pessoas percam a confiança umas nas outras.

Como sabemos, já no primeiro governo de Lula explodiu um dos maiores escândalos de corrupção da história mundial, o Mensalão.

Nele, foram desviados dos cofres públicos pelo menos R$100 milhões de reais — dinheiro este que poderia ter sido utilizado para ajudar os pobres e salvar as vidas que o Lula e o PT tanto dizem defender.

Quando estamos diante de uma retrospectiva da história do partido mais corrupto que o nosso país já teve, uma constatação é inevitável: esse papo de que "vou votar no PT em defesa da democracia" não cola.

Ou você defende o PT ou defende a democracia.

Ator Victor Fasano explica quem é Lula - o pai da mentira! Você vai deixar ele te enganar DE NOVO? 
